  display: flex;
  justify-content: space-between;
  padding: 1rem 2rem;
  background: #333;
  color: #fff;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 1rem;
  a {
    text-decoration: none;
    color: #fff;
    &:hover {
      text-decoration: underline;
    }
  }
`;

